  input: '"TEXT","F3XA",,"Re:Your letter dated March 27,2002, the PAC retains Williams
    & Jensen to administer the PAC''s activities, including receipts, disbursements,
    preparing the FEC reports and acting as custodian of the PAC''s records. The PAC
    pays the firm a monthly fee which includes those administrative expenses to which
    you refer in your letter, such as rent, utilities, office equipment, etc.  With
    regard to the alleged excessive contribution, Northern Lights reimbursed Ted Stevens
    for beverages he paid for for an event for Kyl for Senate.  The payment to Mr.
    Stevens was therefore reported as an in-kind to Kyl for Senate from Northern Lights.
    It is not an excessive contribution to Stevens for Senate."'
